insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (45568,'远古外星人第五季',45,1,'pic/uploadimg/2013-1/201301745568.jpg',0,'',0,NULL,'George,Noory,Robert,Clotworthy,Jonathan,Young','01集','','<p>有没有可能在数千年前智慧生命已经访问过地球，带来了他们的科技，彻底的改变了人类历史发展进程？由Erich von Daniken撰写，1968年出版的畅销书《诸神的战车》提出了一个&ldquo;远古外星人&rdquo;的理论，颠覆了人们对于人类进程的信念。远古洞穴壁画中奇异的生物，秘鲁的飞机跑道遗迹，和印第安文字中所描述的&ldquo;神的飞行器&rdquo;这些反常的考古文物只是一小部分被von Daniken引用作为远古外星宇航员早已被我们的祖先所熟知的例证。</p>',0,'',0,NULL,'2013-12-25 08:17:41.000',2012,'欧美','百度影音$$第01集$bdhd://205414693|C02421A067F915AD4AADE995A6BA3411|远古外星人.第五季EP01.rmvb$bdhd$$$qvod$$第01集$qvod://205414693|7A7B8460823D8363742031F917FBE82CB8CCDEE4|远古外星人.第五季EP01.rmvb|$qvod#第02集$qvod://206510199|AA4B5A51DB0F1231BE5CE599463BBBF09D699F48|远古外星人.第五季EP02.rmvb|$qvod#第03集$qvod://294343253|2A3D31B7E62315C8B29CF341BDD4881AD8DF54DF|远古外星人.第五季EP03.rmvb|$qvod#第04集$qvod://289678746|7E2D2228295C1346CD4AB7EE59AB7744F2AC24F8|远古外星人.第五季EP04.rmvb|$qvod','',1,'y','',NULL,'','英语',0,0,0,'yuanguwaixingrendiwuji','2012-12-31 16:08:48.000',0,NULL,1,0,'远古外星人第五季',81906,0,0,0,0,0)
