insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (45745,'食尚玩家2013/食尚玩家',53,20131223,'pic/uploadimg/2013-1/201301845745.jpg',1,'',0,0,'莎莎,艾毛,浩角翔起','20131223','','《食尚玩家》节目每周在TVBS欢乐台首播四期，由莎莎、2moro、浩角翔起等新生代主持人担当主持。所谓&ldquo;食尚玩家&rdquo;，就是在游玩中享受美食，在美食中尽情游玩，所以每一期的《食尚玩家》节目都会选择一个台湾的城市或其他国家的城市，同时设置一个主题，比如省钱游、浪漫游、相亲游、温暖游等，根据这个主题来进行节目的编排，选择当地有代表性或颇受网友好评的餐厅、旅游景点、人文景观、自然风景等，通过主持人在该地区的游历和对该地区的介绍，让观众了解该地区独特的美食、美丽的自然风景和当地的人文习俗等，也会向观众推荐一些颇受当地人好评或颇受网友好评的餐厅、酒店、民宿、夜市、旅游景点、礼品店等，为观众的出行提供了很好的建议，同时，《食尚玩家》节目通过对各个地区的美食和游玩的介绍，向观众传达享受生活、热爱生活的积极向上的观念。',0,'',0,0,'2013-12-25 08:18:41.000',2013,'台湾','百度影音$$20130101$bdhd://307502775|99E24091542014AB91E1E077A0CBC092|食尚玩家-20130101.rmvb$bdhd#20130102$bdhd://302474538|DA245BFA32C499558626AE0622C0223B|食尚玩家-20130102.rmvb$bdhd#20130103$bdhd://308769194|B8A722FF54AA8E9C8C5D2FFFEEC73C7D|食尚玩家-20130103.rmvb$bdhd#20130108$bdhd://309807829|C863E3A2222D5985BE23AF7789B32E8B|食尚玩家-20130108.rmvb$bdhd#20130109$bdhd://303244721|4A49DB65A6EA81F90A0D3B02A49D9B6D|食尚玩家-20130109.rmvb$bdhd#20130110$bdhd://305718272|25554820CCCF82188AA8AB57E4F3823B|食尚玩家-20130110.rmvb$bdhd#20130114$bdhd://306122892|95AC6D7E072E79EC7DAFB554C19583E1|食尚玩家-20130114.rmvb$bdhd#20130115$bdhd://311614338|7548427FCA305CDBA5AE9BD9510CABA8|食尚玩家-20130115.rmvb$bdhd#20130117$bdhd://309714062|D74CBF266B5DC6DFF87E5110E7FD8938|食尚玩家-20130117.rmvb$bdhd#20130121$bdhd://307501103|11E6C75BB37AA586F029F194796EF654|食尚玩家-20130121.rmvb$bdhd#20130122$bdhd://309930943|32AF517038E3E0113AEED7D92C293755|食尚玩家-20130122.rmvb$bdhd#20130123$bdhd://303189578|D85C422D57B28BF448ECDA97495BD141|食尚玩家-20130123.rmvb$bdhd#20130124$bdhd://308461247|68B9CFF5D4D9F759484D63919