insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (45861,'开卷8分钟2013/开卷八分钟/开卷8分钟',52,20131224,'pic/uploadimg/2013-1/201301845861.jpg',3,'',2,0,'梁文道','20131223','独行千里路，不如《开卷8分钟》','<p>现代都市人生活节奏太快，娱乐方式多样，读书越来越成为一种奢侈。《开卷八分钟》是凤凰卫视日播读书节目，由著名学者梁文道先生主持，节目每天用短短的8分钟时间介绍一本书，希望让观众用最简利的方式碰触到书籍的精髓，进入一个又一个迥异又奇妙的书中世界。 梁文道先生见解独到，思维清晰，之前长期担任著名文人谈话节目《锵锵三人行》的嘉宾，与窦文涛和徐子东并称为凤凰卫视的&ldquo;言论铁三角&rdquo;。《开卷八分钟》就像是为梁文道先生量身定做，每天一本书，展现了他知识的渊博和视野的广阔。 节目在书的选择方面是多样化的，包括文学，历史，科学，财经，商业，宗教，人物传记等等。可以说是各个领域，无所不及。 从形式上来讲，8分钟的节目主要分为两部分。第一部分主要讲当天介绍的书。由一段主持人的开场白，或者说是开场故事来带出当天的书。跟着一路讲下去。在讲的过程中，可以适当配合出一些该书的图片和处理过的少量文字。在结束前的一分钟，可以有一些&ldquo;趣谈&rdquo;或者说&ldquo;闲笔&rdquo;来做为第二部分，也就是结尾。 节目的风格会以说故事为主。轻松，活泼，生动是节目的主调。 《开卷八分钟》的口号就是：每天一本书，只要八分钟！</p>',0,'',0,0,'2013-12-25 08:12:20.000',2013,'大陆','qvod$$20130102$qvod://41646958|9A91838D199C75B7CABB10A12165FCDCDCE4C47F|开卷八分钟《with时代的写作――对话《酒国》《生死疲劳》》作者：张旭东莫言_20130102.rmvb|$qvod#20130103$qvod://44932470|B7CF61220670B172127419D739EADE949AA7FA97|开卷八分钟_20130103.rmvb|$qvod#20130104$qvod://41918884|277EE53CB76B5FC4CC21FD329A034B3B96FBF198|开卷八分钟《风中绿李》作者：荷塔.牧勒_20130104.rmvb|$qvod#20130107$qvod://44462775|6E0FD8190C9CC984994F5106CEFE4ECBCD3050BF|开卷八分钟_20130107.rmvb|$qvod#20130108$qvod://45222613|CC54E792DD04C6F61656E24DFDE12D814EEC8FE3|开卷八分钟_20130108.rmvb|$qvod#20130109$qvod://44962944|A8459EE7FF7B8725930F1D1B016B24BE5F409A9D|开卷八分钟_20130109.rmvb|$qvod#20130110$qvod://44066687|21E887230E03BDD0DB0A4024484715CD3450A818|开卷八分钟_20130110.rmvb|$qvod#20130111$qvod://45244850|3FCB2E5D94C22C03ED1F4D645FC5FD79761BE44D|开卷八分钟_20130111.rmvb|$qvod#20130114$qvod://39895390|127E412D03671A8869C35505697EAC97597066F0|开卷八分钟_20130114.rmvb|$qv