insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (45896,'我们约会吧2013/我们约会吧',52,20131224,'pic/uploadimg/2013-1/201301845896.jpg',1,'pic/uploadimg/show/vr2013011905.jpg',0,0,'何炅,杨乐乐,孙骁骁','20131224','18个单身美女等你来牵手','也许是湖南人敢为人先的天性使然，湖南卫视的创新从未间断过，创新已经成为了湖南卫视的品牌标签。继11月连续推出了《百科全说》、《8090》两档节目后，2010年湖南卫视将再度出击，开年第一波将推出时尚潮男何炅领秀的中国第一档单身潮人交友真人秀节目&mdash;&mdash;《我们约会吧》。 湖南卫视2010年全新打造的一档单身潮人交友互动真人秀节目《美的智能电饭煲我们约会吧》，因为何炅的转型加盟，担当&ldquo;牵线月老&rdquo;引得多方关注。然而，更值得注意的是，虽然当下&ldquo;剩男&rdquo;、&ldquo;剩女&rdquo;大行其道我们约会吧，却由原来的&ldquo;被剩&rdquo;转为&ldquo;主动要剩&rdquo;，这中间除了受新时代下新思潮的&ldquo;爱情婚姻观&rdquo;影响外，越来越&ldquo;宅&rdquo;的适婚男女们，交友环境单一，也使&ldquo;婚姻&rdquo;似乎与他们日行渐远。今日记者在录制现场看到，现场参与的男女嘉宾，大胆直白的爱情&ldquo;拷问&rdquo;，使这个潮人交友的平台，激情飞扬、火光四溅，旁人则从中也能窥探到&ldquo;剩时代&rdquo;男女心中的真实情感表白。<br />  女士刁钻出言无情设卡、男士难过情关<br />  舞台上的18个单身女性明艳动人，但口齿伶俐，个个出言柔中带刚，对于陆续现身的男嘉宾，从&ldquo;你有房、有车吗？&rdquo;&ldquo;星座是什么&rdquo;等基础问题开始发起问题攻势，接下来的&ldquo;你是否介意我与前男友联系？&rdquo;、&ldquo;结婚后是否还会与父母同住？&rdquo;等等如连珠炮般的情感拷问，严苛地考验着背冒冷汗的男嘉宾们，但凡他们的回答稍有差池，女嘉宾便会毫不留情地熄灭身前红灯，告诉对方&ldquo;你出局了！&rdquo;。而为爱而战的男嘉宾，自然也不会轻言放弃，依旧会为欣赏自己的女嘉宾奋勇冲关，双方现场交锋不断、场上主持何炅也是机智解围，一场&ldquo;潮人们的集体相亲&rdquo;玩的就是心跳。<br />  版权模式明媒正娶 交友旋风拒抄袭<br />  据湖南卫视新闻发言人李浩介绍，湖南卫视此次与战略合作伙伴英国Fremantle公司进行模式版权合作，正式引进购买了其国际经典电视交友节目《TAKE ME OUT》中国地区的独家专有版权，这也意味着湖南卫视是国内唯一享有创新制作该节目中国版本的独家播出平台，任何湖南卫视之外的电视机构制作、播出与《Take Me Out》模式版权相类似的节目都属于侵犯著作权行为。英国Fremantle公司将保证授权节目无版权纠纷，如在授权区域内出现其他媒体机构制作或播出同类节目或其他任何侵权行为，双方将共同维护湖南卫视的版权权益。<br />  英国FremantleMedia公司中国首席代表邢文宁先生在接受采访时也表示，将来的电视战场&ldquo;创意为王&rdquo;！湖南卫视作为国内首屈一指的卫视，在节目创新、节目营销、节目研发方面走在前端，这也是湖南卫视具有领先战略意识的表现。Fremantle Media 作为国际顶级电视制作公司，拥有全球联网的节目制作机构与创意研发机构，FM一方面十分关注中国电视市场的，另一方面也希望依托自身资源积极为中国电视做出贡献,并在中外电视节目创意、资讯资源分享方面，进行更为深度的合作。<br />',0,'',5,0,'2013-12-25 08:19:04.000',2013,'大陆','百度影音$$20130102$bdhd://563666664|E2F387DF3C42E95A70C9C9A8A538EAAC|我们约会吧20130102.rmvb$bdhd#20130108$bdhd://481365926|6C1C231957516A1A5D29F1E97AD59644|我们约会吧20130108.rmvb$bdhd#20130109$bdhd://641848733|89BBAE50D14A228B44FBA3FE127C7E17|我们约会吧20130109.rmvb$bdhd#20130115$bdhd://616634746|E167CF759E2607A208E7CCA3E38D5A39|我们约会吧20130115.mp4$bdhd#20130116$bdhd://632021905|74CEFEF3CBF8D650EE78305AF4022862|我们约会吧20130116期.HDTV.rmvb$bdhd#20130122$bdhd://635098290|B41C3AB5FFF336072D80BA16D23B0499|我们约会吧20130122期.HDTV.rmvb$bdhd#20130123$bdhd://682608493|DB951406F03B39D94C88C869B1753512|我们约会吧20130123期.HDTV.rmvb$bdhd#20130129$bdhd://662374910|BD381D69C4D5437CD039EC6B931EA59D|我们约会吧20130129.mp4$bdhd#20130130$bdhd://672886048|3E4D0E5145427521612C145DC3D363CF|我们约会吧20130130期.HDTV.rmvb$bdhd#20130205$bdhd://480698872|96D3C07CEA2B1A6B7967130550FD2020|我们约会吧20130205.rmvb$bdhd#20130206$bdhd://494069406|F7CB1F4CD4092E31478BFB0BEF9230EF|我们约会吧20130206.rmvb$bdhd#20130212$bdhd://671899496|C8414EEBF6663E9FAA542BA2AC0E90D1|我们约会吧_20130212.mp4$bdhd#20130213$bdhd://652378457|1D2A1A2B7995BE80B9A21C3B37C51884|我们约会吧20130213.mp4$bdhd#20130219$bdhd://592300535|CFF58F7997295A12459A69121BF8503F|我们约会吧20130219期.HDTV.rmvb$bdhd#20130220$bdhd://616267985|F4D3E311E56E095C05524FA8FFED2FD4|我们约会吧20130220期.HDTV.rmvb$bdhd#20130226$bdhd://591945933|3F3CAF51781A28285137F64A7CA1B9FF|我们约会吧20130226期.HDTV.rmvb$bdhd#20130227$bdhd://582792155|FBDED67350F7F818291921310B761216|我们约会吧20130227.rmvb$bdhd#20130305$bdhd://669044546|69F7925267DAECAC3C2573844216C06F|我们约会吧20130305期.HDTV.rmvb$bdhd#20130306$bdhd://703253121|C7C57F308270CF7CEA3FAD9C297F6F8B|我们约会吧20130306期.HDTV.rmvb$bdhd#20130312$bdhd://620902674|A300B449C42BF7C66D6F40E4ABFE9765|我们约会吧20130312期.HDTV.rmvb$bdhd#20130313$bdhd://631225033|AA2AE007C7BAF9BF0F502CFF37267299|我们约会吧20130313期.HDTV.rmvb$bdhd#20130319$bdhd://581756839|8FAD9FFB62F22C325E99419CF7300EA8|我们约会吧20130319期.HDTV.rmvb$bdhd#20130320$bdhd://576861706|B286