insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (52141,'重案组第2季',45,16,'pic/uploadimg/2013-6/2013062352141.jpg',0,NULL,0,0,'Mary,McDonnell,Amy,Sykes','16集',NULL,'本剧是TNT旗舰剧集《罪案终结者》（The Closer）的衍生剧。 洛杉矶警署重案组仍然为Brenda Leigh Johnson的离去感到惋惜和不安，他们意识到现在Raydor警长（Mary McDonnell）是他们的头了。和他们的前任「老板」不同，Raydor倾向于使用「以团队为中心的目标管理模式」，与她的手下人一起分担责任，分享荣辱??正应了那句话，「有福同享有难同当」。但Raydor首先必须在团队中建立起自己的威信，要让所有的侦探们都信任她，对她百分之百服气，这绝不是件容易的事情！ 不过Raydor的心血没有白费，她的努力工作得到了手下人的赞许，他们对她的能力也有了全面的了解??尽管他们仍然忘不掉她在内务调查处的那段历史。试想她曾经将他们所有人和他们的前任「老板」当作犯人来怀疑，他们又怎能轻易原谅她呢？Provenza尤其对Raydor不满，因为他始终认为Raydor对于刑侦工作是个门外汉，至少不及他懂得多??一个什么都不懂的女人有什么资格对他发号施令？ 来自《罪案终结者》的G.W. Bailey（Provenza）、Tony Denison（Andy Flynn）、Michael Paul Chan（Tao）、Raymond Cruz（Julio Sanchez）和Phillip P. Keene（Buzz Watson）将继续演出该剧，扮演他们原来的角色。Robert Gossett和Jon Tenney将客座演出。该剧的内容、形式和《罪案终结者》没有本质区别，但Raydor和Brenda Leigh Johnson的办案风格还是有区别的。Brenda采用各种手段诱骗嫌疑人招供，后面的事情她就不管了；而Raydor倾向于收集足够的证据来逼迫嫌犯自己认罪，从而为司法系统节省时间和金钱，也避免了恼人而冗长的上诉过程。',0,NULL,0,0,'2013-12-25 08:18:59.000',2013,'欧美','百度影音$$第01集$bdhd://171518945|211C627EEAE4DDFC8B384CC80F06DD6A|重案组第二季01.rmvb$bdhd#第02集$bdhd://165240931|82A3783FF5303AA95F29D9E98DA74DE1|重案组第二季02.rmvb$bdhd#第03集$bdhd://176505159|270FFF80BDA9E739D3955D109A9B1D58|重案组第二季03.rmvb$bdhd#第04集$bdhd://171854151|9F30DC8B056C3A45C116622DCD03D673|重案组第二季04.rmvb$bdhd#第05集$bdhd://159448590|2D9CE80D93ED9740C439C41CFF82AB98|重案组第二季05.rmvb$bdhd#第06集$bdhd://203419581|5710E62B15249419F71C1BC1029F90DF|重案组第二季06.mp4$bdhd#第07集$bdhd://201172595|21F3C4631A0EEC7AF72F3E2DFF3E2AA8|重案组第二季07.mp4$bdhd#第08集$bdhd://203697114|116F46BD95A33DF010AECE3AF3EC0229|重案组第二季08.mp4$bdhd#第09集$bdhd://110250892|3EF57F6AE26698EF484942