insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (55298,'多谢款待',43,73,'pic/uploadimg/2013-10/2013102055298.jpg',NULL,NULL,0,0,'杏,东出昌大,原田泰造,财前直见','73集',NULL,'卯野芽以子是在经营西餐厅的父母的精心养育下成长起来的少女，极其贪吃，寄住在卯野家的大学生西门悠太郎也被这种情形震撼了，不久他便被 “从我想吃到让我吃”的芽衣子的热情征服，与此同时，芽以子也对这位固执地“想要建造世界上最安全房屋”的男子产生了好感，对着想要建造大阪新的街道的悠太郎，芽以子对着他说，“请让我一生都吃喜爱的食物，我也想让你一生都吃喜爱的食物。”芽以子以这种方式向悠太郎求婚并成为了他的妻子。  　　后来芽以子嫁到了大阪的世家，但她时髦的西餐却遭到了婆家人的拒绝，东京与大阪的口味大不相同，大阪家庭料理最重要的是“始末”的精神，抱着“价格昂贵并且美味的料理即使是傻瓜都会做”的想法嫁过来的芽以子，在面对了挥金如土的婆婆，回娘家的姐姐和不擅长处理家庭关系而发呆的公公等人后，“要让丈夫幸福就要让他的家人幸福”，芽以子开始领悟到大阪料理“始末”的精髓，开始做出了感化西门一家人的料理。  　　然而这时战争却开始了，芽以子守护者自己的家人，在战乱的年代也积极乐观地努力生活下去',0,NULL,0,0,'2013-12-25 08:18:38.000',2013,'日本','百度影音$$第01集$bdhd://172385018|90B6DC0EB02C3D13630DDD6562C1DDE3|多谢款待01.mp4$bdhd#第02集$bdhd://194088574|2D931CDD8280EC65D1BDB492347389C9|多谢款待02.mp4$bdhd#第03集$bdhd://192946675|AE845194D19E9E98FC58C6F47E65AFFB|多谢款待03.mp4$bdhd#第04集$bdhd://154883228|E7FEA9ABFF86E19E611E745400D462EF|多谢款待04.mp4$bdhd#第05集$bdhd://180895933|6F27873EA0C404A4A8FCFD435A438681|多谢款待05.mp4$bdhd#第06集$bdhd://181762737|8F281E2D53D92F119BAEC28F5A87BDB5|多谢款待06.mp4$bdhd#第07集$bdhd://186197914|3C0F50C962D03AD2263DFC7C45904870|多谢款待07.mp4$bdhd#第08集$bdhd://175767082|4991B56BEB7733A56BCB0D85B7898B2C|多谢款待08.mp4$bdhd#第09集$bdhd://150882437|6F9D8A89A72CE8AE13C0601AABC4CF50|多谢款待09.mp4$bdhd#第10集$bdhd://141121941|9B03929BBAAFC1AEBE42EDCB59BEA851|多谢款待EP10.mp4$bdhd#第11集$bdhd://173568325|27059CD63F850D3B14D29CC4D80FE5A9|多谢款待11.mp4$bdhd#第12集$bdhd://171528310|E7D155F6A049363CB17F3FE96C89315D|多谢款待12.mp4$bdhd#第13集$bdhd://199838973|AB74D15FE9F80A6F930DA1F5A0BB3EC8|多谢款待13.mp4$bdhd#第14集$bdhd://178768052|5FC73AF3229C8FD65E1CB0C13A488