insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (56781,'结婚好吗',41,20,'pic/uploadimg/2013-12/201312156781.jpg',NULL,NULL,0,0,'天心,修杰楷,邵翔,安唯绫','19集',NULL,'夜深人静，亚真望著熟睡的女儿语桐，最後下定决心，在离婚协议书上签下了名字，对於数次外遇的丈夫至修，亚真决定不再苦等他的回头&hellip;&hellip;  飞机划过晴空。浪漫的冲绳婚礼正在布置会场，明天就是亚真的好友群芳嫁给婚顾公司长子李皓权的大喜日，亚真连日来忙碌的穿梭其中，打点大小事项，因为她就是这场重要婚礼的主策划，而此战也是她能不能升上经理的关键一役，她抛开了离婚的伤心，全心全意的筹备著婚礼。 子轩是这场婚礼的伴郎，他与新郎皓权相识於当兵时，亚真亲自到机场去接这位贵客，经过一连串波波折折後终於穿出拥挤的人潮，鞋跟断了、头发乱了，一身狼狈的接到子轩，令子轩莞尔又惊艳，还暗暗的吹了声口哨。然而，前往婚礼会场途中，两人却因为子轩虽然表面祝福皓权，但却不经意流露出对於婚姻的不屑而擦枪走火，就在两人快起争执之时，车子却意外抛锚了，在等待修理的同时，亚真想起往事，居然悲从中来的落泪，子轩没有多问，只是借出了自己的背，让亚真靠著哭泣，在美丽的蓝天白云下，一场恋爱拉开了序幕&hellip;.',0,NULL,0,0,'2013-12-25 08:12:06.000',2013,'台湾','百度影音$$第01集$bdhd://268760750|58ECB726FD497C4499E0A4F01BD18FC3|结婚好吗-01.rmvb$bdhd#第02集$bdhd://227370585|74D37ABD390D6FDD628FC1F391C69DBB|结婚好吗-02.rmvb$bdhd#第03集$bdhd://225815091|477C69F9066032C25AF7585B792C826E|结婚好吗-03.rmvb$bdhd#第04集$bdhd://224205284|EFB58BA12A77F28642BB9BDB1C57DC9C|结婚好吗-04.rmvb$bdhd#第05集$bdhd://220049250|415E273505BEDBEDD4A5231B58F66F3C|结婚好吗-05.rmvb$bdhd#第06集$bdhd://220373478|CAE27D66725B9FAC9FF98742B6237952|结婚好吗06.rmvb$bdhd#第07集$bdhd://220118768|D2F86F357030A5FA722D167E3EAAAB42|结婚好吗07.rmvb$bdhd#第08集$bdhd://225824497|84BDA08813AD078D260BD6651D42738E|结婚好吗08.rmvb$bdhd#第09集$bdhd://221740653|32B2E044063036D99BF52CAFF27EA556|结婚好吗09.rmvb$bdhd#第10集$bdhd://223061972|0408F5EED83F01B31B8298DB015C6C62|结婚好吗10.rmvb$bdhd#第11集$bdhd://224740974|C025E18C8AB7D74E86343DF8BA452D79|结婚好吗11.rmvb$bdhd#第12集$bdhd://220601293|508EB49201D30A54B7E557C5B4132C66|结婚好吗12.rmvb$bdhd#第13集$bdhd://221876064|6A6D30338F5DB69EBA1CC3037A22379D|结婚好吗13.rmvb$bdhd#第14集$bdhd://221829674|BFDE74B2