insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57021,'天龙八部 2013/新天龙八部钟汉良版',40,9,'http://pic.cnjuc.com/pic/uploadimg/2013-12/20131240102621525.jpg',0,'',2,1,'钟汉良,/,金起范,/,金铭,/,张檬,/,贾青,/,贾静雯,/,高圆圆,/,苏有朋,/,张馨予','09集','','2013年版《天龙八部》改编自武侠大师金庸的同名小说，全剧以宋哲宗时代为背景，通过宋，辽，大理，西夏，吐蕃等王国之间的武林恩怨和民族矛盾，从哲学的高度对人生和社会进行审视和描写，展示了一幅波澜壮阔的古代生活画卷。本剧由浙江华策影视和东阳大千影视投资出品，香港著名导演赖水清执导，钟汉良领衔主演。 剧情简介： 北宋年间，外族纷纷觊觎大宋国土，形成宋、辽、西夏对立的局面。武林各派或效忠于本国，或相助于他族，一时间风云际会，英雄辈出。　　武林第一大帮丐帮帮主乔峰，公正豪迈，威名远扬，人称之为武林霸主&ldquo;北乔峰&rdquo;。因其拒绝副帮主之妻康敏的求爱而遭报复，被指为契丹人后裔而一夜之间威名堕地，受尽中原武林人士唾弃。乔峰竭力为自己平反，遂四出云游追查身世，期间认识了大理皇帝段家 的世子段誉及少林寺的虚竹和尚，三人结拜为兄弟。　　乔峰追寻身世时屡遭奸人所害，含冤莫白，更错杀红颜知己阿朱，后又为救阿朱之妹阿紫而寻医至大辽国，辗转成为大辽国的南院大王。但其与中原武林的关系则更趋恶劣，并在聚贤庄一役中与不少英雄侠士决裂。',0,'',0,0,'2013-12-25 08:18:58.000',2013,'大陆','qvod$$第1集$qvod://301434372|7BB641406CEF09C045F070894452A9145FEC6650|天龙八部_钟汉良版_HDTV_01.rmvb|$qvod#第2集$qvod://285391227|C825AB0A229F41FCA5839AE9EA953F5379B202EB|天龙八部_钟汉良版_HDTV_02.rmvb|$qvod#第3集$qvod://309075775|EA1F6DBA23449F6866730D15930E674ACADD1980|天龙八部_钟汉良版_HDTV_03.rmvb|$qvod#第4集$qvod://278136002|BE1B587CC36908F4276F369C31549CB3F2B2777E|天龙八部_钟汉良版_HDTV_04.rmvb|$qvod#第5集$qvod://335767888|E6B43044CADAA6983595FD2EDD4665F3E3ECB53F|天龙八部_钟汉良版_HDTV_05.rmvb|$qvod#第6集$qvod://393273706|8A9FB035541F0B8509F9ACEAD58768356DAC3FC3|天龙八部_钟汉良版_HDTV_06.rmvb|$qvod#第7集$qvod://256691995|101C34859CDF46D4934D80D1E4122039E6FA9B96|天龙八部_钟汉良版_HDTV_07.rmvb|$qvod#第8集$qvod://322401464|2C16063C5CEEB9F8504585AE1F9FC09F5B661548|天龙八部_钟汉良版_HDTV_08.rmvb|$qvod#第9集$qvod://341823307|22F8844874887FD967F681885D2E08CC6EC827B7|天龙八部_钟汉良版_HDTV_09.rmvb|$qvod$$$百度影音$$第01集$bdhd://176563029|B18A6D6C8121A39CF4BB146AA689B364|新天龙八部01