insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57071,'粘豆包',40,29,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013129110445471.jpg',0,'',0,0,'李菁菁,秦卫东','缺25-28','','白莲有一个幸福的家，丈夫在一次建房上梁时砸成瘫痪，不能动弹丧失了一切生活能力，祸不单行，房子又意外起火，生活压力都压在白莲的身上，为了生活，白莲想办法谋生，但都不能如愿。丈夫不想拖累白莲，l让白莲改嫁，希望有好人帮白莲抚养幼子，走投无路的白莲和丈夫选择离婚。白莲不想抛弃杜强，要求杜强跟着自己出嫁。杜强虽不愿，但拗不过白莲，最终随着白莲一起嫁到新家。小山村出现了亲情，友情，爱情的温馨一幕。新婚的老憨外表看似粗人，但心地善良，热心助人，生活中给白莲和杜强充分的照顾和理解，为了特殊的家庭付出很多，老憨用爱情、友情和亲情以及实际行动感化了杜强和子女们，杜强最终带着感谢和安慰离开了他们。乡政府领导和村里帮助白莲一家靠着祖传手艺粘豆包，还清欠债，生活越来越好，和老憨齐心帮助儿女们成家立业！',0,'',0,0,'2013-12-25 08:20:53.000',2013,'大陆','qvod$$第1集$qvod://160135272|B409E4E514D611A3CE7A3E4D0A8892F300E61163|粘豆包01.rmvb|$qvod#第2集$qvod://157547366|385E81C396F9C7C836E10727B89CFD5A26076973|粘豆包02.rmvb|$qvod#第3集$qvod://157165253|DBE5686D987505D2EC4B335DD02FC24774A12F1B|粘豆包03.rmvb|$qvod#第4集$qvod://157275290|1FC584A7AAF85A02C0E808078AB431A1F22D0715|粘豆包04.rmvb|$qvod#第5集$qvod://156857429|E2E7D75E84657076F4001BBD5C1FF405BBD1FE25|粘豆包05.rmvb|$qvod#第6集$qvod://157591720|A7E528C9782441E7A46AECB3A20954CA550647DC|粘豆包06.rmvb|$qvod#第7集$qvod://158987032|A704F4DA8108369704064959C9C1F88F3456ADC0|粘豆包07.rmvb|$qvod#第8集$qvod://151321926|B919CC77E80D2E53219BC265A3C50EA6794AE2BD|粘豆包08.rmvb|$qvod#第9集$qvod://153402045|50F761673D1E6A7A1E9697E4A1592E662CEE2B85|粘豆包09.rmvb|$qvod#第10集$qvod://151894406|337E5E8434EF4B6F37842AE6ECDB590070A82C4D|粘豆包10.rmvb|$qvod#第11集$qvod://150884832|BF224515616A793963E7340667DC4A147663F0D4|粘豆包11.rmvb|$qvod#第12集$qvod://151635661|60F44A666CB7E799E66C44D3A5120F9DBAED94B0|粘豆包12.rmvb|$qvod#第13集$qvod://153334254|6C12BBD78F7CDA28AFDB654D1B2CD6FB3019D999|粘豆包13.rmvb|$qvod#第14集$qvod://151647998|09F908A1B715