insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57118,'总理和我',44,6,'http://pic.8888fy.com/pic/uploadimg/2013-12/201312101411477950.jpg',NULL,NULL,0,0,'李凡秀,林允儿,蔡贞安,李敏豪,尹施允','06集',NULL,'总理与我讲述的是新人热血记者南多贞与新上任国务总理权律之间由误会生出绯闻到真的结婚的故事.李凡秀饰演失去了妻子领着3个孩子生活的权律,虽然社会名望很高但却是个0分爸爸,允儿饰演虽然一开始不爱权律但为了权律总理的位置而与他结婚,成为了这个家新妈妈的南多贞.故事就在新妈妈产生的过程中展开.制作组表示&quot;请期待李凡秀-允儿CP饰演的今冬奇迹般的爱情故事,这是部可以和家人们一起看的温暖的童话般的浪漫喜剧&quot;.',0,NULL,0,0,'2013-12-25 08:19:05.000',2013,'韩国','qvod$$HD01$qvod://264682566|7C40F26E32D8D25ADB2B4DB2D46B03D4E33BC4F8|总理和我01.rmvb|$qvod#HD02$qvod://263681412|45CF0F834783F05529C67097D0B4F7987F351491|总理和我02.rmvb|$qvod#HD03$qvod://279916526|46C023912AC4F124FD576E0549E79C4DD909AD85|总理和我03.rmvb|$qvod#HD04$qvod://282110489|3AD5B5897BF5FA90036324DEF07270177D176F0A|总理和我04.rmvb|$qvod#HD05$qvod://276080610|E5C388A43CBF16CD8C15D70ED9B40E1137B8C011|总理和我05.rmvb|$qvod#HD06$qvod://267773798|173E0C15478F5071B6BFDC8C337028DCEF456404|总理和我06.rmvb|$qvod$$$百度影音$$第01集$bdhd://264682566|F17859DA8F628E3B2DEB66E54B749CE0|[TSKS]总理和我01.rmvb$bdhd#第02集$bdhd://263681412|3ED23B5BA3D11BC0BA7CE80B1013EBB5|[TSKS]总理和我02.rmvb$bdhd#第03集$bdhd://279916526|D74F4E8C37EB87B6C27D925D2B1E3C65|[TSKS]总理和我03.rmvb$bdhd#第04集$bdhd://282110489|1EE2114051679D91EAD8464393B83B3C|[TSKS]总理和我04.rmvb$bdhd#第05集$bdhd://276080610|3759120D6050545445B960E62675D138|[TSKS]总理和我05.rmvb$bdhd#第06集$bdhd://213034610|49C13B78980208F70602458DECDD8970|总理和我06.rmvb$bdhd',NULL,1,'z','',0,'李少渊','韩语',0,0,0,'zonglihewo','2013-12-11 10:59:13.000',0,0.00,0,0,'总理和我',88965,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57127,'聂荣臻',40,29,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013121220532243643.jpg',NULL,NULL,0,0,'林永健,齐欢,墨阳,王伍福,郭伟华,卢奇','29集',NULL,'该剧讲述了1925年秋，聂，聂荣臻结束留学生活回到祖国，在黄埔军校担任政治部秘书等职，开始其戎马生涯。中共中央成立军事部，聂荣臻竭力协助周恩来工作。1929年他与地下交通员张瑞华结婚不久后，被调到上海&quot;特科&quot;工作，紧急处置了顾顺章叛变事件。解放战争时期，聂荣臻率部 &quot;三战三捷&quot;，扭转政治局势战局。全国解放，中央提出研发原子弹的想法，聂荣臻积极成立国防部五院。经过艰辛努力，中国第一颗原子弹成功爆响，与此同时，他还主持中国第一艘核潜艇建造和第一颗卫星研制工作。文化大革命时期，聂荣臻想方设法保护知识分子和科学家，亲自主持第一颗氢弹试验，为我国人民解放和国防军事现代化做出了重大贡献。',0,NULL,0,0,'2013-12-25 08:18:59.000',2013,'大陆','百度影音$$第01集HDTV$bdhd://244008787|F3F5E46771B70FA603461AB08CEA2780|聂荣臻01.rmvb$bdhd#第02集HDTV$bdhd://221100274|67F1554751BBFC751646E7E687E9003E|聂荣臻02.rmvb$bdhd#第03集HDTV$bdhd://238239397|A374BA64769D3767A8A517141FD0D0F8|聂荣臻03.rmvb$bdhd#第04集HDTV$bdhd://240661103|543514E9FF2AE76AB44F1F9B681CACE9|聂荣臻04.rmvb$bdhd#第05集HDTV$bdhd://365606899|E12B8D4129EFF7DCE22925DE9AC6FAA3|聂荣臻05.rmvb$bdhd#第06集HDTV$bdhd://365774273|480C9452242DF12DCF2430E94CD1A96C|聂荣臻06.rmvb$bdhd#第07集HDTV$bdhd://279588115|10A9622D22C75A14663159ACE5A5E14C|聂荣臻_HDTV_07修正.rmvb$bdhd#第08集HDTV$bdhd://477226433|80FE3B1A700C240E9049A16B12A76B3B|聂荣臻_HDTV_08.rmvb$bdhd#第09集HDTV$bdhd://343481258|9D8717933083E9BF410826016A61AF89|聂荣臻_HDTV_09.rmvb$bdhd#第10集HDTV$bdhd://419161361|3C9061DB6313E4A462D7D4B53A852351|聂荣臻_HDTV_10.rmvb$bdhd#第11集HDTV$bdhd://405338470|14403A15D8C1FA3297416AA5B794F2E6|聂荣臻_HDTV_11.rmvb$bdhd#第12集HDTV$bdhd://353490875|EFDC8D3E99EF999AE1C5C353CB03E34D|聂荣臻_HDTV_12.rmvb$bdhd#第13集HDTV$bdhd://384528183|2C2F9B37EF4000114D53E8E206AC9631|聂荣臻_HDTV_13.rmvb$bdhd#第14集HDTV$bdhd://383944007|CBFC394EE8705209335FC438247F5E