insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57133,'XGirl',40,11,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312131855565679.jpg',NULL,NULL,0,0,'张经伟,周秀娜,王茗,李昕岳','10集',NULL,'三个妖艳美丽的大妞一丝不挂地在一个空房间中醒来，她们忘记了一切过往，甚至自己的身份都完全不知。突如其来的追兵更是让她们困惑和恐惧，她们合力逃脱，惊奇地发现在各自的身上都有着超于常人的特异功能。小警官钓丝陈涛误打误撞地救下了三个美妞，并从此居于一室。陈涛决定帮助三人寻找各自的身份，作为交换，三个女孩用自己的特异功能帮陈涛侦破无数离奇案件。她们每接近真相一步，也就离危险更近一步，看似波澜不惊的生活其实危机重重，而她们却完全不知这一切都处于一个大阴谋之中&hellip;',0,NULL,0,0,'2013-12-25 08:12:15.000',2013,'大陆','百度影音$$第01集$bdhd://209008972|408FB3607780E10905B7E4A51E83A572|XGirl/妙探三姐妹01[超清版].mkv|$bdhd#第02集$bdhd://186248512|FE003D1E7CA4665E810B6AA1B94BABB0|XGirl/妙探三姐妹02[超清版].mkv|$bdhd#第03集$bdhd://195092996|FD8E651A0D689329A56286429C568FD1|XGirl/妙探三姐妹03[超清版].mkv|$bdhd#第04集$bdhd://189873752|941DA4BA6852218050B02D4C969DB669|XGirl/妙探三姐妹04[超清版].mkv|$bdhd#第05集$bdhd://184708493|DAB463FBCBDDF77B66FC7843055B918D|XGirl/妙探三姐妹05[超清版].mkv$bdhd#第06集$bdhd://191711598|2AB5EA68B2422DBEC6C273C059246C05|XGirl_妙探三姐妹06.mkv$bdhd#第07集$bdhd://192157553|C398DD526E6D7A611F951AF29FB27EDD|XGirl_妙探三姐妹07.mkv$bdhd#第08集$bdhd://190099327|6A240CD97D3E949DF50DF182968E98F8|妙探三姐妹08.mkv$bdhd#第09集$bdhd://189959408|A9E219F15A111468673F85CA898CC5F9|XGirl_妙探三姐妹09[超清版].mkv$bdhd#第10集$bdhd://231433607|A5120516AE31D0C4636268080EFE51A3|XGirl 妙探三姐妹10[超清版].mkv$bdhd$$$qvod$$第1集$qvod://209008972|8B6B65B5D0EF3C24265E3AD3FAA665D29E313DA9|XGirl/妙探三姐妹01[超清版].mkv|$qvod#第2集$qvod://186248512|A03C567BE4127F755469DF08941C509CA9C590D3|XGirl/妙探三姐妹02[超清版].mkv|$qvod#第3集$qvod://195092996|EF60C606E4356B589055B3592D04F81CE5975B4C|XGirl/妙探三姐妹03[超清版].mkv|$qvod#第4集$qvod://189873752|6EE3AEAFA0349697CE129B26A7EACADFAD1C1B76|X