insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57150,'烽火佳人',40,31,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312158171622654.jpg',NULL,NULL,0,0,'舒畅,/,陈键锋,/,乔振宇,/,石小群,/,李智楠,/,吴岱融','31集',NULL,'上世纪20年代，出身没落皇族之家的新女性佟毓婉因救命之恩寄情军中勇士周霆琛，却被迫奉父母之命嫁给实业家杜瑞达之子杜允唐。佟毓婉埋下心中苦楚，在杜家复杂家境中逆势求生，成为上海商界呼风唤雨的女大亨。丈夫杜允唐纨绔不羁，却是毓婉生意上的最佳搭档。周霆琛投身革命。毓婉少时伙伴黎绍峰以乞儿之身冒充黎家独子，后将妹妹黎雪梅献给军阀沈之沛，又投靠日本洋行，与杜氏实业争夺码头开发。佟毓婉与恋人周霆琛，丈夫杜允唐，友人黎雪梅，仇人黎绍峰、孪生姐妹青萍、红羽之间产生了一系列情感纠葛，也经历了一系列权、利、欲交织的阴谋。经过军阀混战、华洋商战、北伐战争等烽火岁月。最终，佟毓婉在烽火乱世中参透盛衰离合，为革命捐出全部身家，与丈夫隐居东北小镇。',0,NULL,0,0,'2013-12-25 08:18:57.000',2013,'大陆','百度影音$$第01集$bdhd://595410426|AF316CA193F19231955DBF1F8741D537|烽火佳人_720P_01.rmvb$bdhd#第02集$bdhd://499394870|812705D29615CA7235FB39FD34C05B7E|烽火佳人_720P_02.rmvb$bdhd#第03集$bdhd://250351116|BF92AD749E66CCC207BCF3C73A3F7003|烽火佳人_HDTV_03.rmvb$bdhd#第04集$bdhd://275296397|49175985A7432C58803B9377F7CBA124|烽火佳人_HDTV_04.rmvb$bdhd#第05集$bdhd://301488520|804D64115CD84FD4806151AC9CA4A2F6|烽火佳人_HDTV_05.rmvb$bdhd#第06集$bdhd://247563428|765C4C970252190350CA88B38AA137DD|烽火佳人_HDTV_06.rmvb$bdhd#第07集$bdhd://249662485|9107EB90102A083773E1BD3E85A77F97|烽火佳人_HDTV_07.rmvb$bdhd#第08集$bdhd://161331392|F009BEE06BECA43D0362A14E22D9869A|烽火佳人08无水印.rmvb$bdhd#第09集$bdhd://118884221|C6891036CDC48CC3BF1532DF2921E125|烽火佳人09无水印.rmvb$bdhd#第10集$bdhd://260010862|7FA90003FE3D344C71BB066A6FD5B8FF|烽火佳人_HDTV_10.rmvb$bdhd#第11集$bdhd://122784247|7658B3D964B1A5B46DCD13462D82EBB8|烽火佳人11无水印.rmvb$bdhd#第12集$bdhd://261631617|4CED26B5CA4979EEC65814BAE53DB5FA|烽火佳人_HDTV_12.rmvb$bdhd#第13集$bdhd://261770451|5019257DD6FDDA172A437E9EF2BBBF3D|烽火佳人_HDTV_13.rmvb$bdhd#第14集$bdhd://292426323|07B46DB325C1E64A11D394FCD17FAE90|