insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57200,'幸福媳妇成长记',40,27,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312152017895241.jpg',NULL,NULL,0,0,'甘婷婷,戴娇倩,李健,田岷,顾璇','27集',NULL,'80后英语教师叶筱羽知性阳光，与年轻有为的丈夫林磊是出了名的恩爱伴侣。突然家中闯入三个不速之客。一个是心高气傲、生活自理能力低下却又遭遇生活重大变故的戏曲名伶婆婆；一个是外表追求时尚、内心追求精神，正在逃避一段感情的空姐小姑；一个是海归回来，看似楚楚动人实则满腹心机的老公前女友。她们怀着各自的秘密挤进了叶筱羽的家。筱羽与三个女人经历了时敌时友的磨合后，关系逐渐变化，先是帮小姑解开爱情的心结，后又帮婆婆在老年活动中心完成了重登舞台的心愿，同时筱羽的一番劝导也让婆婆终于反省到自身存在的问题)。过程中，筱羽也坚定了宽容和爱的信念，三人的关系不仅从天敌变成了闺蜜，还一起结盟面对一个共同的敌人-前女友徐倩倩。婆媳、姑嫂齐心协力一起帮筱羽阻止了林磊与徐倩倩的婚礼，保卫了她的爱情和婚姻。最终，徐倩倩也幡然醒悟，认识了爱情的真谛，回到了生活的正轨。经历分分合合，筱羽和林磊还能和好如初吗？林父和林母是否还能走到最后？小姑林燕是否真的找到了自己的真爱归宿？三个女人执着的走在通往幸福的路上。',0,NULL,0,0,'2013-12-25 08:18:58.000',2013,'大陆','百度影音$$第01集$bdhd://172458056|0BE80AF2C9D0F672FA17EA7A7C0AC37B|幸福媳妇成长记01.rmvb$bdhd#第02集$bdhd://160114612|5C0960392B617B7F8B134EBC5FD6D580|幸福媳妇成长记02.rmvb$bdhd#第03集$bdhd://168125975|7841172645B61F4CCCA038129A3EFFAE|幸福媳妇成长记03.rmvb$bdhd#第04集$bdhd://262104186|22F459429CB2AC9BA35DEA06ACAC4DE6|幸福媳妇成长记04.mp4$bdhd#第05集$bdhd://181283960|E4B3481AF375E782EB75AA6D115416DB|幸福媳妇成长记05.rmvb$bdhd#第06集$bdhd://267565377|CAFA6307351C6C175549F73F9B5D412D|幸福媳妇成长记HDTV06.rmvb$bdhd#第07集$bdhd://153152793|6861E9BD5CD8D676645C21F13F965496|幸福媳妇成长记07.rmvb$bdhd#第08集$bdhd://177935998|E870C598247B5D67DC1C87DAD09C6076|幸福媳妇成长记08.rmvb$bdhd#第09集$bdhd://176869339|16FEBEB5D5836118385A106EAAFC6C52|幸福媳妇成长记09.rmvb$bdhd#第10集$bdhd://166074124|CE0E26AB74B7FFC4869C599938538DF3|幸福媳妇成长记10.rmvb$bdhd#第11集$bdhd://181928901|D3C9F9279F6892443F0F25727FD881F1|幸福媳妇成长记11.rmvb$bdhd#第12集$bdhd://157372746|60F48DFC4D00C2F3278F5A012663E670|幸福媳妇成长记12.rmvb$bdhd#第13集$bdhd://173541582|18D5F034858AD2675D737