insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57203,'戎装女人',40,27,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013121723485285508.jpg',NULL,NULL,0,0,'徐帆,高明,吴亚桥,任天野,郭冬临','27集暂缺第17,20-23集',NULL,'六位光荣的军人儿女，但家里定要出一位将军的宿愿落在唯一还保有希望的小女儿，政治部主任吕师(徐帆饰)肩上。面对刚刚得知患有癌症，心有不甘的老父亲，步入更年期的吕师感觉到越来越重的压力。吕师异于时代的清高品格不只仅成了独特的标签，也成为了晋升将军的绊脚石。调查下属杨新光和贺建国升任二团委的不良竞争案的过程中，吕师自己也觉得走进了一个暗流汹涌，不由自主的漩涡；与此同时，儿女众多的军人大家庭也同寻常百姓一样，布满了纷纷扰扰，不同的这些都逃不开军人之家的往事纠葛，吕师貌似美满的婚姻竟然也是其中的一段。部队与家庭，回忆与现实，这一切早不再泾渭分明，就在吕师的更年期一同化作狂风暴雨奔涌袭来。吕师身着戎装，好似傲寒的梅花，这场洗礼中绽放，展露进去的不只仅是一名军人的骨气，更有一位女人的芬芳。戎装女人》以女性视角去关照现代军营的每个角落以及军营所辐射出来的周边世界，紧紧围绕一个“爱”字和一个“情”字展开情节：父母儿女之爱，上下级之爱，军民之爱，祖国之爱和浓郁母女情，战友情，爱情紧密交织在一起。某通信总站政治部主任吕师，个土生土长的女军官，从话务员干起，一步步走上了领导岗位。吕师的老父亲吕振堂共有五儿一女，大儿子吕班没有选择入伍而是当了教授。二儿子吕排从军了却意外地牺牲在一场边境战争中。三儿子吕连是个聪明的哑巴。四儿子吕营留洋日本。五儿子吕团最聪明能干，下海经商成了大款。戎装女人》中国首部原生态的部队大戏。人物生动故事新鲜，以女性视角去关照现代军营的每个角落以及军营所辐射出来的周边世界，紧紧围绕一个“爱”字和一个“情”字展开情节：父母儿女之爱，上下级之爱，军民之爱，祖国之爱和浓郁母女情，战友情，爱情紧密交织在一起，构成这样一部细节丰富，好看耐看的电视剧。人物介绍 剧中主要人物吕师，15岁不到就离家来到军营当话务兵，那种清水挂面似的短发，忠贞不渝地留了将近二十年，更不要说穿戴了女兵和女人一字之差，其内涵和深和深度却相距甚远，其间埋藏着无限的人生曲折和生活智慧。女大校吕师的故事从她走马上任某通信总站政治部主任才真正开始。本剧讲述了老顾问长吕振堂(高明 饰)家中有四男两女。',0,NULL,0,0,'2013-12-25 08:18:59.000',2013,'大陆','百度影音$$第01集$bdhd://144510566|1A839862C83EDA233B63DCA17C6754DB|戎装女人01.rmvb$bdhd#第02集$bdhd://145888488|12D66280BEF3960701FA4346D060362F|戎装女人02.rmvb$bdhd#第03集$bdhd://146100394|207F6F83EBCECDE54AF63543BA4B29D1|戎装女人03.rmvb$bdhd#第04集$bdhd://141126187|83E15DFCF22B088A415D364FD3E67CD9|戎装女人04.rmvb$bdhd#第05集$bdhd://150109631|AD8F7DEC7CA8E9D8F92BE20CAAE326AD|戎装女人05.rmvb$bdhd#第06集$bdhd://138564952|7B3039356D7B2AFA214B0F48AEE0F97A|戎装女人06.rmvb$bdhd#第07集$bdhd://144884147|4C089DC541FC0F9F49E7C9F9FC7D904D|