insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57204,'利箭纵横',40,38,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013121523113410617.jpg',NULL,NULL,0,0,'于震,王力可,刘流,左腾云','完结',NULL,'《利箭纵横》是《利箭行动》第二部，利箭行动的兄弟篇，故事讲述：1938年春，一架日军战斗机迫降鲁西南山地，掌握重要军事机密的日本间谍桥本隆一潜逃。由李剑带领的利箭特战队奉命抓获桥本隆一，并从桥本的口中获得重要情报，即日军目标徐州，欲占据霍山城为大后方，进而发动徐州战役。李剑及利箭特战队作为先遣部队，挺进霍山城，执行代号为&ldquo;纵横&rdquo;的特别任务。利箭特战队在淮北小镇遇上杂耍艺人王大力和龙方，众人一同火烧皇协军军营，擒住土匪，智取皇协军武器，成功占领霍山城。之后与鲁西南八路军刘团长部队及林筱雨领导的霍山城游击队会合，大败赵家圩子保安队和霍山城驻守日军部队，坚守霍山城。南京76号特工所特派员张怡梅潜入赵家圩子，秘密联合赵家集，策反土匪，惹出不少事端。李剑等人一次次化解危机，并联合土匪黄占魁，神枪手虎子等人解放赵家集。利箭特战队顺利完成任务，彻底粉碎了日军阴谋，稳固皖西南，建立根据地，迎接纵队司令员率主力部队的到来。',0,NULL,0,0,'2013-12-25 08:18:46.000',2013,'大陆','百度影音$$第01集$bdhd://176242333|11E81C8ABB80F542F25DEA4251A38B82|利箭纵横01.rmvb$bdhd#第02集$bdhd://144951194|24CAFC880576BF1B8D1B2EE9CAD98510|利箭纵横02.rmvb$bdhd#第03集$bdhd://201908918|EDABF5796B3FC7E04FE2324008A6A249|利箭纵横03.rmvb$bdhd#第04集$bdhd://100096410|E1A389C7697FB86540A1A1C43A6D6B64|利箭纵横04.rmvb$bdhd#第05集$bdhd://193238780|4D31515B405D37ABD7FD5ACFB3279724|利箭纵横05.rmvb$bdhd#第06集$bdhd://201627545|CCCB94CC603D0D073E302F7D7F337432|利箭纵横06.rmvb$bdhd#第07集$bdhd://195428003|5974E67AAD7421DD1EEF50F77F69975D|利箭纵横07.rmvb$bdhd#第08集$bdhd://206956835|398632A10FE995C6C78199D10583EA72|利箭纵横08.rmvb$bdhd#第09集$bdhd://239931258|8FEE3F34A7424E96711AF7DDEF998DD1|利箭纵横09.rmvb$bdhd#第10集$bdhd://230607975|FCAAB851BA3098DCB9726674D579E2AB|利箭纵横10.rmvb$bdhd#第11集$bdhd://201356002|56AC4DB23B9A8D4EC85E0FD69906D74D|利箭纵横11.rmvb$bdhd#第12集$bdhd://228514027|3463C6E24EFA97CA33A2155AE0324104|利箭纵横12.rmvb$bdhd#第13集$bdhd://169618644|662C0D85C9326FE9FEDAC385ED7576CC|利箭纵横13.rmvb$bdhd#第14集$bdhd://152354708|D929E1DA210444F