insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57290,'猫屎妈妈(粤语)',41,2,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013122322432394561.jpg',NULL,NULL,0,0,'黄宗泽,/,岑丽香,/,胡定欣,/,王浩信,/,米雪,/,杜燕歌','02集',NULL,'女强人马思雅（米雪饰）为事业打拼，时间表排得密密麻麻，她不容许自己浪费时间，也不想丈夫和女儿浪费时间。她的丈夫边册（杜燕歌饰）是出版社编辑，重质量不重销量，重视过程而不重视结果。就以喝咖啡为例，边册是咖啡爱好者，喜欢慢慢冲调和品，但对思雅来说，咖啡只有提神功用，夫妻步伐不一致，距离愈来愈远。就在二人婚姻走到冰河时期之际，边册跟替边贵知（岑丽香饰）补习的学姐苏眉（胡定欣饰）因为性情相近而愈走愈近。最后，思雅和边册离婚收场，边册继而娶了苏眉。贵知从小到大一直按照思雅为她订下的时间表做人，甚至到外国留学读医，都是思雅的意愿而非自己的理想。未料就在她读医的第三年，边册车祸离世，令贵知顿时反思自己廿多年来在追赶甚N。同时，边册生前正筹备开设一间咖啡店，响应西方国家提倡的「慢活」生活，即放慢生活节奏，细味人生的生活态度。贵知决定继承父亲遗愿，暂时休学，经营咖啡店，顺便趁机「停一停，想一想」，思考清楚医生是否将来一生想走的路。',0,NULL,0,0,'2013-12-25 08:18:57.000',2013,'香港','百度影音$$第01集$bdhd://309659943|A18BCEB28FD35D17865ACEFAB38DD125|猫屎妈妈01高清TV粤语.rmvb$bdhd#第02集$bdhd://259728802|82F616E9A32F22E9EA4BF2932C81E697|猫屎妈妈[高清TV粤语]02.rmvb$bdhd$$$qvod$$HD01$qvod://309659943|90E9478AA5335EEB1CC0D2B3ADE47E56DE6E9606|猫屎妈妈粤语01.rmvb|$qvod#第2集$qvod://321207426|DF1FBD9F21ABAE8CCF3A7FDBCEC6CA5454EC2CF7|猫屎妈妈粤语_HDTV_02.rmvb|$qvod',NULL,1,'m','',0,'张乾文','粤语',0,0,0,'maoshimamayueyu','2013-12-23 22:37:58.000',0,0.00,0,0,'猫屎妈妈(粤语)',89135,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57291,'恋爱的那点事儿',40,4,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312232259669051.jpg',NULL,NULL,0,0,'杜淳,/,佟丽娅,/,薛佳凝,/,周一围,/,张璇,/,萧浩冉,/,苏小明','04集',NULL,'该剧主要是讲述四个大龄女青年寻找真爱的故事，她们分别代表了当下社会大潮中不同风格的四种女性：“亚熟女”“白富美”“蜗牛女”和“潘棵谩保各自带着不同的寻爱宣言在爱情的路上摸爬滚打。  　　“亚熟女”是在爱情路上总能把清水搅浑，然后发现找不着心目中的白马王子了。“白富美”则像三毛所说：“如果爱，1000万人家也嫁；如果不爱，100万姐也不嫁！”而“蜗牛女”则是率先葬送爱情的，她们以为进了婚姻就相当于找到了保护壳，结果不是被妖艳的小三打败，就是被自己的黄脸婆扮相弄颓。而“潘棵谩痹蚴窃礁咴剿г讲话，越矮越锉越心疼。',0,NULL,0,0,'2013-12-25 08:18:57.000',2013,'大陆','百度影音$$第01集$bdhd://378901177|139D320025BCCDC6CEE9B7EC671625DF|恋爱的那点事儿01.mp4$bdhd#第02集$bdhd://275593336|5F187D66DB8493E9A230E4D35E007A2D|恋爱的那点事儿02.mp4$bdhd#第03集$bdhd://233009864|F178EA20D367C69DB5D0AF95EA395694|恋爱的那点事儿03.mkv$bdhd#第04集$bdhd://276873647|94432AFCFF33ADFD9DB0B504EB45A0C2|恋爱的那点事儿04.mp4$bdhd$$$qvod$$第1集$qvod://399599700|6C13EF77AF2F79A01A6A65C3C6F2FB21641E734B|恋爱的那点事儿_HDTV_01.rmvb|$qvod#第2集$qvod://280397570|CA49537879011E8E31732D41F8543040A3F0EFDE|恋爱的那点事儿_HDTV_02修正.rmvb|$qvod#第3集$qvod://211002646|97E4E0AE44D50BCF3D614F347BA6097D8DBF2C9F|恋爱的那点事儿_HDTV_03.rmvb|$qvod#第4集$qvod://279738709|2A15D80BAAE993D966AE8DFEE7A46406014CB0A7|恋爱的那点事儿_HDTV_04.rmvb|$qvod',NULL,1,'l','',0,'谭朗昌,/,祝东宁','国语',0,0,0,'lianaidenadianshier','2013-12-23 22:59:40.000',0,0.00,0,0,'恋爱的那点事儿',89136,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57292,'破晓之爱(国语)',41,3,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312232352518437.jpg',NULL,NULL,0,0,'Wongsakorn,Poramathakorn,Davik','03集',NULL,'女主人公ram，在母亲去世之后，饱受冷酷无情的继母chandran的摧残，她不得以逃离她的父亲所居住的家manookul。为了逃脱，她躲进了khun chai（M.R.Thitirat Kamales）的后车厢。khun chai同情这个小女孩，于是收留她。ram的父亲从来没有想过要她回去。但因为ram的姑姑mali，ram不得不和khun chai分离，回去继续面对继母和她的女儿pen。但是ram还是幸运的，pen不像她妈妈那样对ram恶言相向，家她的女儿pen。但是ram还是幸运的，pen不像她妈妈那样对ram恶言相向，家里也有一位老仆人对ram很是照顾，更有mali的儿子tom（manthep）保护她，tom一直喜欢着ram。继母chandra有个表chutima，她是个心肠恶毒的女人，常常把ram当女仆使唤，逼迫她为她做任何事情。日子一天天过handra有个表chutima，她是个心肠恶毒的女人，常常把ram当女仆使唤，逼迫她为她做任何事情。日子一天天过去，ram再次见到khun chai。而此时khun的身份却是pen的未婚夫。因为ram的父亲mern曾经救过khun chai的父亲，因此khun chai的父亲承诺khun chai将和mern的女儿结婚。对ram毫无关心的父亲和自私自利的继母都认为pen比ram（或者说mayarassamee，是chai的父亲为ram取的名字）适合做khun chai的妻子，pen才应该是&ldquo;silalai庄园&rdquo;的女主人。谁才会是&ldquo;silalai庄园&rdquo;的女主人？谁才应该拥有Kamales Na Ayudhya姓氏（khun chai家族的姓氏）。Ram和khun chai的爱以及用他们的善良会解决这一切问题吗？',0,NULL,0,0,'2013-12-25 08:19:05.000',2013,'泰国','百度影音$$第01集$bdhd://161609677|69D1A21B840FC4CD156473624AD83BC1|破晓之爱01国语版.rmvb$bdhd#第02集$bdhd://163197674|C4A1AA8491922AB9B3655000B66F767D|破晓之爱02国语版.rmvb$bdhd#第03集$bdhd://171867773|94436DDD1E68E24D12FB85A9EAC5115C|破晓之爱03国语版.rmvb$bdhd$$$qvod$$第1集$qvod://161609677|55BBA27A3F115CBC9713C7AE4F836F7068A46573|破晓之爱01国语版.rmvb|$qvod#第2集$qvod://163197674|81D5869399D1C2376B5BFE8F75E62C91CD697A93|破晓之爱02国语版.rmvb|$qvod#第3集$qvod://171867773|18897C570E0FDB914E457B7F8CD27D6A5851B0CA|破晓之爱03国语版.rmvb|$qvod',NULL,1,'p','',0,'','国语',0,0,0,'poxiaozhiaiguoyu','2013-12-23 23:53:14.000',0,0.00,0,0,'破晓之爱(国语)',89137,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57302,'先锋1931',40,7,'http://pic.8888fy.com/pic/uploadimg/2013-12/2013122321411185466.jpg',NULL,NULL,0,0,'郭凯敏,章,陈旺林,张春,孟醒,高木贞佑','07集',NULL,'&nbsp;1931年9月18日，日本关东军对中国发动侵略战争。蒋介石领导的国民党东北军的不抵抗导致节节败退。中共通过驻莫斯科代表团从境外派来先锋特遣队，指导满洲武装斗争。队长高健以医疗救护队副队长的身份进入牡丹江，和东北义勇军21旅张旅长会合一致抗日。高健在敌人必经之地放火攻敌,伏击天野旅，天野少将被俘。中国共产党领导满洲军民打响抗战第一枪。天野旅的重创使日本出台一个彼岸花计划，意图侦察中共远东国际交通站地下交通线。&lt;br /&gt; 　　高健利用牡丹江大同医院掩护，建立秘密国际交通联络站，先锋特遣队队员丁元复成为医院院长。老邮差成为单线联络人。日本军方掌握了先遣队的情报，医疗队遭到怀疑，富间和丹妮娅被派进医疗队监视队员的行动。高健和苏共党员情报人员丹妮娅取得联系。丹妮娅和日本陆军特务机关长饭村让见面，扮演双面间谍。',0,NULL,0,0,'2013-12-25 08:18:56.000',2013,'大陆','qvod$$第1集$qvod://127403716|5B63461EACFD24FA5E19449363BBB93A5207938A|先锋1931第1集.rmvb|$qvod#第2集$qvod://150668353|0785FD497468E0E6D26760CDE175028ED91D9FEA|先锋1931第2集.rmvb|$qvod#第3集$qvod://127324220|4CB8C85A16E7378F746F07FE0EE37D27258F67FF|先锋193103无水印.rmvb|$qvod#第4集$qvod://127430671|30B0003E5B75A1BF231ABDA14E5414A08251EBA1|先锋193104无水印.rmvb|$qvod#第5集$qvod://127299238|0B50701C3D404CF02B1831D7192B41215560185F|先锋193105无水印.rmvb|$qvod#第6集$qvod://127419575|3FD35DFEE436BB552BA5EB23276FC2AB42C34398|先锋193106无水印.rmvb|$qvod$$$百度影音$$第01集$bdhd://127403716|77CCC2F7C6B1F975CAA1638E5AC459AD|先锋1931第1集.rmvb|$bdhd#第02集$bdhd://150668353|E98ECC9895AB1D456ECDC2058670C3C6|先锋1931第2集.rmvb|$bdhd#第03集$bdhd://127324220|713DB538CA875E37D6B14015E1C040AF|先锋1931-03无水印.rmvb$bdhd#第04集$bdhd://127430671|8713ABB086F291E925E48E885D21FDF4|先锋1931-04无水印.rmvb$bdhd#第05集$bdhd://127299238|98DF41A5915F40A0E50F25A6F7998C01|先锋1931-05无水印.rmvb$bdhd#第06集$bdhd://127419575|3716824BF30D2AF9D5A4A3DB414A0735|先锋1931-06无水印.rmvb$bdhd#第07集$bdhd://127328123|C5BA1554408C0387