insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57303,'大掌门',40,7,'http://pic.8888fy.com/pic/uploadimg/2013-12/2013122321472891589.jpg',NULL,NULL,0,0,'童瑶,张桐,曹力,国歌,姜超','07集',NULL,'该剧讲述&ldquo;七七事变&rdquo;前后，&ldquo;年画之乡&rdquo;杨家埠的年画传承人杨德龙和杨德利兄弟争夺年画掌门人的故事。这是国内首次在荧屏上展示出&ldquo;国粹&rdquo;年画雕刻、印刷等手工绝活，呈现出年画的发展v程、制作工艺等，展示了民间年画艺人的传奇人生。与大多讲述乱世儿女情长、家族恩怨兴衰的抗战剧不同，该剧反映了杨家埠民间艺人和爱国志士为保住祖宗传承下来的艺术瑰宝，与日本侵略者斗智斗勇、拼死抗争的精神。',0,NULL,0,0,'2013-12-25 08:18:56.000',2013,'大陆','qvod$$第1集$qvod://130364099|A3740E531E055AAB030F04755396367046E59A57|大掌门第1集.rmvb|$qvod#第2集$qvod://128782172|9790D72BA91BCB65AE24D2DA8DF7484CCCC09168|大掌门第2集.rmvb|$qvod#第3集$qvod://127594034|1043B7150409DBB11ED19EC6E746E7EEDC7AC8B4|大掌门第3集.rmvb|$qvod#第4集$qvod://126993402|7AEAD24FB75C78100BA0764B87EBD7D90B157451|大掌门04无水印.rmvb|$qvod#第5集$qvod://127904294|B34D54558AF8DA6FB7EDC2CD74B930DD339EB282|大掌门05无水印.rmvb|$qvod#第6集$qvod://127845102|9B009087FEB98C413AAE35D3B693CE02CA3560C9|大掌门06无水印.rmvb|$qvod$$$百度影音$$第01集$bdhd://130364099|C579080974383EEB99AE541F55702E9C|大掌门第1集.rmvb$bdhd#第02集$bdhd://128782172|DE82CFC777A2A27C7589B11358C715A2|大掌门第2集.rmvb$bdhd#第03集$bdhd://127594034|0AE5B825019B48E478D515F42D803A8B|大掌门第3集.rmvb$bdhd#第04集$bdhd://126993402|EB6A0CF9C3B3F77C736F142EA07B21D0|大掌门04无水印.rmvb$bdhd#第05集$bdhd://127904294|6993F68A14306BB42494DF9F8ADAC694|大掌门05无水印.rmvb$bdhd#第06集$bdhd://127845102|95AE6A958157B60CCCE86BA3FB529FC7|大掌门06无水印.rmvb$bdhd#第07集$bdhd://127461366|4562A6FE6A7E08EA7150AB3749F02B21|大掌门07无水印.rmvb$bdhd',NULL,1,'d','',0,'孙铁军,郭林','国语',0,0,0,'dazhangmen','2013-12-24 00:03:32.000',0,0.00,0,0,'大掌门',89148,0,0,0,0,0)
