insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57306,'猫屎妈妈(国语)',41,1,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013122412244390629.jpg',NULL,NULL,0,0,'黄宗泽,岑丽香,胡定欣,米雪,王浩信,杨爱瑾','01集',NULL,'女强人马思雅（米雪饰）为事业打拼，时间表排得密密麻麻，她不容许自己浪费时间，也不想丈夫和女儿浪费时间。她的丈夫边册（杜燕歌饰）是出版社编辑，重质量不重销量，重视过程而不重视结果。就以喝咖啡为例，边册是咖啡爱好者，喜欢慢慢冲调和品，但对思雅来说，咖啡只有提神功用，夫妻步伐不一致，距离愈来愈远。就在二人婚姻走到冰河时期之际，边册跟替边贵知（岑丽香饰）补习的学姐苏眉（胡定欣饰）因为性情相近而愈走愈近。最后，思雅和边册离婚收场，边册继而娶了苏眉。贵知从小到大一直按照思雅为她订下的时间表做人，甚至到外国留学读医，都是思雅的意愿而非自己的理想。未料就在她读医的第三年，边册车祸离世，令贵知顿时反思自己廿多年来在追赶甚N。同时，边册生前正筹备开设一间咖啡店，响应西方国家提倡的「慢活」生活，即放慢生活节奏，细味人生的生活态度。贵知决定继承父亲遗愿，暂时休学，经营咖啡店，顺便趁机「停一停，想一想」，思考清楚医生是否将来一生想走的路。',0,NULL,0,0,'2013-12-25 08:18:28.000',2013,'香港','百度影音$$第01集$bdhd://266217792|29574D0EFB55B0D3F24B0CE0039697DB|猫屎妈妈[国语DVD]01.rmvb$bdhd$$$qvod$$第1集$qvod://266217792|B8AEB1CCDF40D09D6A05D4A93CC0218C92377671|猫屎妈妈国语01.rmvb|$qvod',NULL,1,'m','',0,'','国语',0,0,0,'maoshimamaguoyu','2013-12-24 12:26:24.000',0,0.00,0,0,'猫屎妈妈(国语)',89151,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57307,'奥克斯战争',31,0,'http://pic.cnjuc.com/pic/uploadimg/2013-12/2013122414224078797.jpg',NULL,NULL,0,0,'Rusty,Joiner,Masiela,Lusha,Wesley,John','BD+HD',NULL,'一场战斗疲惫的前特种部队操作工买在偏远的美国西部牧场逃离世界，&lt; 一场战斗疲惫的前特种部队操作工买在偏远的美国西部牧场逃离世界。遇到一个奇怪的系列侵入者，包括一个美丽的精灵公主和美国原住民的神秘和兽族。当兽人入侵他产业，约翰必须放弃他隔离成为英雄之前，世界上发挥他龙神兽族。',0,NULL,0,0,'2013-12-25 08:12:05.000',2013,'欧美','qvod$$BD$qvod://903458881|DD455FCD4881B762BA502B2C17BACC26A99C9190|奥克斯战争BD.rmvb|$qvod#HD$qvod://1708711489|FF9BC8736A7E99A40E6AAC466CF3A9B0E404F66B|奥克斯战争HD.mkv|$qvod',NULL,1,'a','',0,'Kohl,Glass','英语',0,0,0,'aokesizhanzheng','2013-12-24 14:25:27.000',0,0.00,0,0,'奥克斯战争',89152,0,0,0,0,0)
insert m_RemoteData(m_id,m_name,m_type,m_state,m_pic,m_chkpic,m_bigpic,m_hit,m_digg,m_actor,m_note,m_info,m_des,m_topic,m_color,m_commend,m_wrong,m_addtime,m_publishyear,m_publisharea,m_playdata,m_downdata,m_isunion,m_letter,m_keyword,m_tread,m_director,m_lang,m_dayhit,m_weekhit,m_monthhit,m_enname,m_datetime,m_recycle,m_score,m_ishtml,m_remote,m_shortName,m_tempid,m_score1,m_score2,m_score3,m_score4,m_score5) values (57308,'行走阴阳界/灵异档案第1季',45,0,'http://pic.cnjuc.com/pic/uploadimg/2013-12/201312241613594631.jpg',NULL,NULL,0,0,'保罗・布莱克索恩,瓦勒里・克鲁斯,康拉德・科茨','完结',NULL,'Harry Dresden和你生活在同一个世界里，和你一样是个有血有肉的人。不同的是，他是个巫师，一个愤世妒俗、看破人间百态的巫师。这使他对周围发生的一切奇怪事件有独一无二的观点－－包括犯罪。  　　Dresden依靠自己的洞察力来获悉即将要发生的事情，特别是犯罪，让那些讨人厌、疑心病又重的警探们很是不满。想知道世界是怎样运转的吗？想知道未来是什么样的吗？好好学学Dresden的档案吧。  　　又是一部根据畅销书改编的电视剧（今年有好几部这样的电视剧，比如Men in Trees），主角是很普通的私人侦探Harry Dresden，但他有一点也不普通的超能力（&hellip;&hellip;不知该怎么说了，人们喜爱&quot;超能力&quot;还真是爱得发疯，看看现在正在播出的电视剧，有多少部提到了超能力、超自然？）。他可以预先看到各种袭击、绑架或谋杀事件，而那些坏蛋都是具有超自然力的家伙，他们一点也不在乎人类的痛苦。  　　作为一个巫师，他要做的事情－－也许是唯一的事情－－就是在芝加哥的电话黄页上不断查找新线索。不管是心不甘情不愿地替警察解决那些棘手问题还是调查自己的案子，他都用自己冷酷的幽默来与邪恶战斗。  　　故事一开始，一个本地的黑帮成员Tommy Tom和他的女友Jennifer Randall被人发现死在旅馆房间里，心脏双双被人挖走。这种令人生畏的情况无法用常理来解释：没有破门而入的痕迹，没有打斗的痕迹，也不像是自杀。也许只有Dresden才能解决这个案件',0,NULL,0,0,'2013-12-25 08:18:40.000',2007,'欧美','百度影音$$第01集$bdhd://174699134|991AF1D71A354ADDD33341550C400E1B|灵异档案S01E01.rmvb$bdhd#第02集$bdhd://169688725|BFBC32550465D5D94C05E7B376061A47|灵异档案S01E02.rmvb$bdhd#第03集$bdhd://169285463|A1AA309BE84544FA53B70CCAF5EC3857|灵异档案S01E03.rmvb$bdhd#第04集$bdhd://173118760|C985C0F7DBDE87309BB3EDFA97B924D1|灵异档案S01E04.rmvb$bdhd#第05集$bdhd://170582388|3F482D151F3656ADDCF799510B1062AF|灵异档案S01E05.rmvb$bdhd#第06集$bdhd://173262249|40628C2A107ADB2F928759F2E7ED7464|灵异档案S01E06.rmvb$bdhd#第07集$bdhd://157123542|0DDF50E102176A2ABE02CF4C4E160F6B|灵异档案S01E07.rmvb$bdhd#第08集$bdhd://158021525|77380959E107BCBEE06A3665FCFBC8C0|灵异档案S01E08.rmvb$bdhd#第09集$bdhd://156963181|99CA14C23B4F735A8E2298420DE0A04F|灵异档案S01E09.rmvb$bdhd#第10集$bdhd://156618448|E1ACADF0B6831A2A59BB1CEDE2